import { Component } from "react";
import React from "react";

class Chat extends Component {
  render() {
    const {
      messages
    } = this.props;
    return (
      <ul className="Messages-list">
        {messages.map(m => this.renderMessage(m))}
      </ul>
    );
  }
}

export default Chat;
